                        content:
                            '**Promptbook Project Components**\n\n1. **Book Language**  \n   A human-readable, Markdown-based language for developing AI applications, workflows, and automations like chatbots, knowledge bases, and translators. It emphasizes simplicity and accessibility for non-programmers while maintaining functionality.\n\n2. **Promptbook Engine**  \n   This engine executes applications written in Book language. It is available as multiple NPM packages and Docker images.\n\n3. **Promptbook Studio**  \n   A web-based editor and runner for Book applications, currently in an experimental MVP stage.',
