                            '## Book Language Details\n\n### What: Workflows, Tasks, and Parameters\nDefines the workflow needed to complete tasks. Workflows have fixed inputs and outputs, adaptable for various scenarios (e.g., generating articles on different topics).\n\n### Who: Personas\nDescribes the virtual employees (personas) carrying out tasks. Personas are defined in human language, specifying their traits and roles, and abstract away complex model parameters.\n\n### How: Knowledge, Instruments, and Actions\nOutlines the resources personas use. \n- **KNOWLEDGE**: Documents, websites, etc.\n- **INSTRUMENT**: Real-time data (e.g., time, weather).\n- **ACTION**: Tasks like sending emails or creating files.',
